import React from "react";

class News extends React.Component {
	render() {
		return (
			<div className="news_info">
				<p>Title:{this.props.title}</p>
				<p>Description:{this.props.description}</p>
				<p>Content:{this.props.content}</p>
			</div>
		);
	}
}

export default News;
